  font-family: inherit;
}

a {
  color: #212124;
  text-decoration: none;
}

input {
  margin: 1.6rem 0;
}

section, article, header, footer, nav {
  display: block;
}

ul li {
  margin: 1.6rem;
  list-style: none;
}


button {
  border-radius: 6px;
  box-sizing: border-box;
  border: 1px solid #ced4da;
  color: #212529;
  text-align: center;
  font-weight: 700;
  background-color: #fff;
  margin: 1.6rem 0;
  text-decoration: none;
  cursor: pointer;
}

body {
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
  color: #212529;
  font-weight: 400;
  min-height: 100%;
}





// HEADER
header {
  .head-bar {
    background-color: #fff;
    color: #212124;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    max-width: 100vw;
    z-index: 999;
    
  }

  .head-container {
    height: 5.6rem;
    box-sizing: border-box;
    padding: 1.2rem 1.6rem;
    justify-content: space-between;
    width: 100%;
    margin: 0 auto;
    position: relative;
  }
  ._contains {
    display: flex;
    align-items: center;
  }

  .logo {
    display: inline-flex;
    align-items: center;
    margin-right: 4rem;
    span {
      margin: -0.1rem 0;
    }
  }
  
  @media screen and (min-width: 768px) {
    .head-container {
      max-width: 120rem;
      height: 6.4rem;
    }
  }


  //NAVIGATION
  .navigations {
    display: none;
  }

  .navigations--ul {
    display: inline-block;

    .navigations--li {
      display: inline-block;
      margin: 0;

      .navigations--a {
        font-weight: 700;
